// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract voting {
    uint public abhiVotes;
    uint public aklavyaVotes;

    mapping(address => bool) public hasVoted;

   function voteAbhi() public {
        require(!hasVoted[msg.sender], "You have already voted");
        abhiVotes++;
        hasVoted[msg.sender] = true;
    }

    function voteAklavya() public{
        require(!hasVoted[msg.sender] , "you have already voted" );
        aklavyaVotes++;
        hasVoted[msg.sender] = true;
    }

    function getAbhi() public view returns (uint){
      return abhiVotes;
    }


    function getAklavya() public view returns (uint){
        return aklavyaVotes;
    }

}
